  "fnSummary": {
    "fnId": "63942",
    "name": "FN63942 - Wireless Lightweight Access Points and WLAN Controllers Fail to Create CAPWAP/LWAPP Connections Due to Certificate Expiration - Software Upgrade Recommended",
    "problemDescription": "Due to the certificate expiration, any new Control and Provisioning of Wireless Access Points (CAPWAP) or Light Weight Access Point Protocol (LWAPP) connection will fail to establish. The main feature that is affected will be the Access Point (AP)-to-controller joining. The secondary feature that is affected will be new mobility connections between the controllers.When an AP attempts to establish a new connection, the AP fails to join. When you configure mobility between controllers, they will fail to establish a connection.The likelihood that this issue will be encountered is 100% for wireless products in use (to include APs and controllers) that have a Manufacturer Installed Certificate (MIC) that is older than ten years. Self-Signed Certificates (SSCs) that were generated by the Autonomous-to-lightweight Upgrade Tool will expire on January 1, 2020.The affected products (listed in the Products Affected section) were released prior to the end of CY2005; beginning in March 2015, the products might begin to experience these symptoms. The MICs of products not listed above will not start to expire until 2018.In order to help determine the potential future impact, a list of APs and Wireless LAN Controllers (WLCs) and their release dates can be found in the Lightweight AP - Fail to create CAPWAP/LWAPP connection due to certificate expiration Cisco Support Forum article.",
    "background": "In the context of this Field Notice, digitally signed X.509 certificates are specifically used for cryptographic identity validation of the device hardware. Authentication of the infrastructure devices is used in order to protect the network from uncontrolled devices. The MICs were incorporated into the Cisco wireless products as a way to provide this identity.Normally, security best practices are to have certificates expire in two years. Due to the expected lifetime and protection of the private key of the hardware, the security policy of the MIC is set to expire ten years from the date of manufacture. The SSCs will expire on January 1, 2020.Note: The Wireless LAN Controller (WLC) Design and Features FAQ has documented the validity period of these certificates.",
    "problemSymptoms": "The wireless APs fail to connect to the WLCs. At the time of the join failure, the WLC msglog might show messages similar to this:Jul 10 16:13:52.443 spam_lrad.c:6164 LWAPP-3-PAYLOAD_ERR: Join request does not contain valid certificate in certificate payload - AP 00:11:22:33:44:55Example for WLC&#39;s MIC expiration case.*Aug 1 05:16:27.127: %PKI-3-CERTIFICATE_INVALID_EXPIRED: Certificate chain validation has failed.The certificate (SN: 423F49A800000005FEAE) has expired. Validity period ended on 14:39:18 UTC Sep 3 2023 Peer certificate verification failed 001A*Aug 1 05:16:27.127: %CAPWAP-3-ERRORLOG: Certificate verification failed!CAPWAP utilizes Datagram Transport Layer Security (DTLS) in order to encrypt communication between the Lightweight AP and the WLC. The MIC or SSC is used in order to authenticate the Lightweight AP to the WLC, and vice versa, during the DTLS session establishment. The CAPWAP/DTLS connection cannot be established after the MIC or SSC validity end date.",
    "workAround": "Temporary WorkaroundIf you believe that your product(s) will be affected by this issue and need a fix before the official code with the associated correction is posted at www.cisco.com, contact the Cisco Technical Assistance Center (TAC). The TAC will work to provide an escalation code accordingly.Recovery for Failed APsNote: This workaround should only be used in order to allow the APs with expired certificates to join the WLCs just long enough to upgrade the software.If the certificates have expired, disable Network Time Protocol (NTP), and then change the WLC clock time to a recent earlier time when the certificates were still valid. If you set the clock back too far, the newer APs might not be able to join. Once the software has been upgraded, and the affected APs have joined, the WLC clock should be reset to the valid time.Note: When you temporarily disable NTP and change the WLC time settings, it can adversely affect other time-dependent WLC features, such as MFP, Simple Network Management Protocol Version 3 (SNMPv3), and Location.SolutionUpgrade to a software version that contains the fix. Cisco has released the fix for Cisco bug ID CSCuq19142 to www.cisco.com for AireOS Versions 7.0.252.0, 7.4.140.0 and 8.0.120.0.For further guidance regarding AireOS releases, see:- TAC Recommended AireOS - https://www.cisco.com/c/en/us/support/docs/wireless/wireless-lan-controller-software/200046-TAC-Recommended-AireOS.html- Guidelines for Cisco Wireless Software Release Migration Bulletin, http://www.cisco.com/c/en/us/products/collateral/wireless/8500-series-wireless-controllers/bulletin-c25-738147.htmlNote: Because the 4400 Series WLCs were among the first manufactured and had both Airespace and Cisco MICs installed, the current fix for Cisco bug ID CSCuq19142 might not work. The Airespace MIC is given precedence by the WLC, and the fix for Cisco bug ID CSCuq19142 is only applicable for Cisco MICs. This is potentially applicable to most 4400 Series WLCs that were manufactured in 2005, and other variants, dependent upon the Return Material Authorization (RMA) and refurbishment history of the affected unit. Refer to the How to Identify Hardware Levels section of this Field Notice for information about how to determine the date of manufacture. If the affected unit was refurbished, the Serial Number (SN) might have changed with the MIC remaining the same. Presently, the only remedy is to disable NTP, and then change the WLC clock time to a recent earlier time when the certificates were still valid. Contact the TAC in order to get an escalation image with the fix for Cisco bug ID CSCuu02970.By default, if an AP and/or WLC certificate has expired, then the DTLS connection will fail. In order to allow the APs to join a WLC after the certificate expiration, upgrade to the fixed software version, and then use the appropriate command for your specific version.For Version 7.0.252.0, use this command:(WLC)>config ap lifetime-check {micssc} enableFor Versions 7.4.140.0 and later, use this command:(WLC)>config ap cert-expiry-ignore {micssc} enableWith these commands in effect, the WLC and AP will ignore the expiration date on the device MICs and SSCs. These commands must remain in effect as long as the devices with expired MICs or SSCs are used.",
